import React from 'react';

const Library = () => {

    return (
        <div style={{ padding: '20px', fontFamily: 'Arial, sans-serif', backgroundColor: '#f4f6f9', minHeight: '100vh', width: '79.2%', alignItems: 'center', marginLeft: 'auto', transform: 'translateY(-94%)' }}>
            {/* Header */}
            <h1 style={{ borderBottom: '1px solid #007BFF', paddingBottom: '5px', color: '#333' }}>Library</h1>
            {/* Modern Faint Yellow Folder Icon */}
            <svg
                xmlns="http://www.w3.org/2000/svg"
                width="48"
                height="48"
                viewBox="0 0 24 24"
                fill="none"
                style={{ marginTop: '20px', marginBottom: '10px', display: 'block' }}
            >
                <rect x="2" y="7" width="20" height="13" rx="3" fill="#FFF9C4"/>
                <path d="M2 7V5a2 2 0 0 1 2-2h5.17a2 2 0 0 1 1.41.59l1.83 1.83A2 2 0 0 0 13.83 6H20a2 2 0 0 1 2 2v2" fill="#FFFDE7"/>
                <rect x="2" y="7" width="20" height="13" rx="3" stroke="#FFE082" strokeWidth="1.5"/>
            </svg>
        </div>
    );
};

export default Library;
